s[8] = "BrookAction.TBrookAction.Register^BrookAction.TBrookAction.html#Register^Registers an action.^    <p>    <p>  APattern Is an expression defining which URLs is allowed to call an action.    <p><b>*</b> &ndash; Represents one single level in the current path. Examples:    <p><code>TMyAction.Register('*');</code>    <p>Can be called as:    <p><a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1\">http://localhost/cgi-bin/cgi1</a> <br> <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/foo/\">http://localhost/cgi-bin/cgi1/foo/</a> etc;    <p><code>TMyAction.Register('/home/*/download');</code>    <p>Means that between &quot;home&quot; and &quot;download&quot;, there is one level. The following replacements could be done:    <p><a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/home/file/download\">http://localhost/cgi-bin/cgi1/home/file/download</a> <br> <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/home/news/download\">http://localhost/cgi-bin/cgi1/home/news/download</a>    <p><b>**</b> &ndash; Represents one or more levels in the current path. Example:    <p><code>TMyAction.Register('/home/**/download');</code>    <p>Means that between &quot;home&quot; and &quot;download&quot;, one or more levels can be set. The following replacements can be done:    <p><a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/home/file/download\">http://localhost/cgi-bin/cgi1/home/file/download</a> <br> <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/home/file/id/25/download\">http://localhost/cgi-bin/cgi1/home/file/id/25/download</a>    <p><b>/</b> &ndash; Adds an slash to the end of the URL if does not exist. Example:    <p><code>TMyAction.Register('/foo/');</code>    <p>Can be called as <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/foo\">http://localhost/cgi-bin/cgi1/foo</a> or <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/foo/\">http://localhost/cgi-bin/cgi1/foo/</a>. When called as <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/foo\">http://localhost/cgi-bin/cgi1/foo</a>, it will automatically redirected to <a  target=\"_parent\" href=\"http://localhost/cgi-bin/cgi1/foo/\">http://localhost/cgi-bin/cgi1/foo/</a>. If the pathinfo is different from <code>/foo</code> a 404 page is returned;    <p><b>:</b> &ndash; Creates variables URL. Their values can be read from the property <a class=\"normal\"  href=\"BrookAction.TBrookAction.html#Values\">Values</a>. Example:    <p><code>TMyAction.Register('/foo/:myvar');</code>    <p>Creates the <code>&quot;myvar&quot;</code>, that can be read from the property <a class=\"normal\"  href=\"BrookAction.TBrookAction.html#Values\">Values</a>, e.g:    <p><code>Write(Values['myvar'].AsString);</code>    <p><b><i>NOTE:</i></b> Two actions can't be registered with the same pattern except when they are called by means of different HTTP methods. ADefault A action registered as <i>Default</i> will be called automatically if the URL does not match with <i>Pattern</i> of any registered actions. It is not allowed to register more than one action as default. A typical example of use is:    <p><code>TMyAction.Register('*', True);</code>  ^0"
s[9] = "BrookAction.TBrookAction.Register^BrookAction.TBrookAction.html#Register^Registers an action specifying the HTTP request method.^    <p>  AMethod Informs the HTTP request method being valid the following options: <code>rmAll, rmGet, rmHead, rmOptions, rmPost, rmPut</code> or <code>rmDelete</code>. The only way to register two actions with the same pattern is differentiating the value of this parameter. If at least one action has this parameter changed, the route mapping is enabled in <a class=\"normal\"  href=\"BrookUtils.TBrookSettings.html#Mapped\">Mapped</a>. A typical example of use is:    <p></p>    <pre class=\"longcode\"> <span class=\"pascal_keyword\">procedure</span> TMyAction1.Get(ARequest: TBrookRequest; AResponse: TBrookResponse);  <span class=\"pascal_keyword\">begin</span>    <span class=\"pascal_keyword\">Write</span>(<span class=\"pascal_string\">'GET'</span>);  <span class=\"pascal_keyword\">end</span>;    <span class=\"pascal_keyword\">procedure</span> TMyAction1.Put(ARequest: TBrookRequest; AResponse: TBrookResponse);  <span class=\"pascal_keyword\">begin</span>    <span class=\"pascal_keyword\">Write</span>(<span class=\"pascal_string\">'PUT'</span>);  <span class=\"pascal_keyword\">end</span>;    <span class=\"pascal_keyword\">procedure</span> TMyAction2.Post(ARequest: TBrookRequest; AResponse: TBrookResponse);  <span class=\"pascal_keyword\">begin</span>    <span class=\"pascal_keyword\">Write</span>(<span class=\"pascal_string\">'POST'</span>);  <span class=\"pascal_keyword\">end</span>;    <span class=\"pascal_keyword\">initialization</span>    TMyAction1.<span class=\"pascal_keyword\">Register</span>(<span class=\"pascal_string\">'/foo1'</span>, rmGet);    TMyAction1.<span class=\"pascal_keyword\">Register</span>(<span class=\"pascal_string\">'/foo1'</span>, rmPut);    TMyAction2.<span class=\"pascal_keyword\">Register</span>(<span class=\"pascal_string\">'/foo1'</span>, rmPost)</pre>    <p>  ^0"
