s[13] = "BrookAction.TBrookAction.UrlFor^BrookAction.TBrookAction.html#UrlFor^Creates an URL for an action informing an array of parameters.^ Exemple:    <p></p>    <pre class=\"longcode\">       <span class=\"pascal_keyword\">procedure</span> TMyAction.Get(ARequest: TBrookRequest; AResponse: TBrookResponse);        <span class=\"pascal_keyword\">begin</span>          <span class=\"pascal_comment\">// When calling with http://localhost/cgi-bin/cgi1/foo/myvalue</span>          <span class=\"pascal_comment\">// the output will be /cgi-bin/cgi1/foo/myvalue</span>          <span class=\"pascal_keyword\">Write</span>(UrlFor(TMyAction, [<span class=\"pascal_string\">'myvalue'</span>]));        <span class=\"pascal_keyword\">end</span>;          <span class=\"pascal_keyword\">initialization</span>          TMyAction.<span class=\"pascal_keyword\">Register</span>(<span class=\"pascal_string\">'/foo/:myvar'</span>)</pre>    <p>    ^0"
